void HypergraphKernels::write_labels(const char *file)  {
    unsigned num_pos(0), num_neg(0);

    ofstream out(file, ios::out);

    out << labels[0];
    labels[0]==1 ? num_pos++ : num_neg++;

    for (unsigned i=1; i<labels.size(); i++)  {
        out << "\n" << labels[i];
        labels[i]==1 ? num_pos++ : num_neg++;
    }
    out.close();

    if (VERBOSE)  {
        cerr << "Positive examples: " << num_pos << endl;
        cerr << "Negative examples: " << num_neg << endl;
    }
}

float HypergraphKernels::random_walk_cumulative(SimpleHypergraph &hg1, SimpleHypergraph &hg2, unsigned hg1_root, unsigned hg2_root, int STEPS, double RESTART)  {
    unsigned e1, e2, i1, i2;
    unsigned hg1_curr_node, hg2_curr_node, hg1_next_node, hg2_next_node, hg1_next_edge, hg2_next_edge;
    float value = compare_labels(hg1.node_labels[hg1_root], hg2.node_labels[hg2_root]);
    vector<unsigned> hg1_incident_edges, hg2_incident_edges;
    
    hg1_curr_node = hg1_root;
    hg2_curr_node = hg2_root;
    int step(1);
    while(step < STEPS)  {
        hg1_incident_edges = hg1.get_incident_edges(hg1_curr_node);
        hg2_incident_edges = hg2.get_incident_edges(hg2_curr_node);
        if (hg1_incident_edges.size() == 0 || hg2_incident_edges.size() == 0)  {
            return value;
        }
        e1 = randint(hg1_incident_edges.size());
        e2 = randint(hg2_incident_edges.size());
        hg1_next_edge = hg1.edge_set[hg1_curr_node][e1];
        hg2_next_edge = hg2.edge_set[hg2_curr_node][e2];
        if (hg1.vertex_set[hg1_next_edge].size() == 0 || hg2.vertex_set[hg2_next_edge].size() == 0)  {
            return value;
        }
        i1 = randint(hg1.vertex_set[hg1_next_edge].size());
        i2 = randint(hg2.vertex_set[hg2_next_edge].size());
        hg1_next_node = hg1.vertex_set[hg1_next_edge][i1];
        hg2_next_node = hg2.vertex_set[hg2_next_edge][i2];
        value = value + compare_labels(hg1.node_labels[hg1_next_node], hg2.node_labels[hg2_next_node]) + compare_labels(hg1.edge_labels[hg1_next_edge], hg2.edge_labels[hg2_next_edge]);
        double prob = randdouble();
        // Restart random walk
        if(prob < RESTART)  {
            hg1_curr_node = hg1_root;
            hg2_curr_node = hg2_root;
        }
        // Continue random walk
        else  {
            hg1_curr_node = hg1_next_node;
            hg2_curr_node = hg2_next_node;
        }
        step += 1;
    }

    return value;
}

float HypergraphKernels::random_walk(SimpleHypergraph &hg1, SimpleHypergraph &hg2, unsigned hg1_root, unsigned hg2_root, int STEPS, double RESTART)  {
    unsigned e1, e2, i1, i2;
    unsigned hg1_curr_node, hg2_curr_node, hg1_next_node, hg2_next_node, hg1_next_edge, hg2_next_edge; 
    float value(0.0);    
    vector<unsigned> hg1_incident_edges, hg2_incident_edges;
    string hg1_walk_seq, hg2_walk_seq;

    if (hg1.node_labels[hg1_root] != hg2.node_labels[hg2_root])  {
        return value;
    }

    hg1_walk_seq.push_back(hg1.node_labels[hg1_root]);
    hg2_walk_seq.push_back(hg2.node_labels[hg2_root]);    
    hg1_curr_node = hg1_root;
    hg2_curr_node = hg2_root;
    int step(1);
    while(step < STEPS)  {
        hg1_incident_edges = hg1.get_incident_edges(hg1_curr_node);
        hg2_incident_edges = hg2.get_incident_edges(hg2_curr_node);    
        if (hg1_incident_edges.size() == 0 || hg2_incident_edges.size() == 0)  {
            return value;
        }
        e1 = randint(hg1_incident_edges.size());
        e2 = randint(hg2_incident_edges.size());
        hg1_next_edge = hg1.edge_set[hg1_curr_node][e1];
        hg2_next_edge = hg2.edge_set[hg2_curr_node][e2];
        if (hg1.vertex_set[hg1_next_edge].size() == 0 || hg2.vertex_set[hg2_next_edge].size() == 0)  {
            return value;
        }
        i1 = randint(hg1.vertex_set[hg1_next_edge].size());
        i2 = randint(hg2.vertex_set[hg2_next_edge].size());
        hg1_next_node = hg1.vertex_set[hg1_next_edge][i1];
        hg2_next_node = hg2.vertex_set[hg2_next_edge][i2];
        hg1_walk_seq.push_back(hg1.edge_labels[hg1_next_edge]);
        hg2_walk_seq.push_back(hg2.edge_labels[hg2_next_edge]);
        hg1_walk_seq.push_back(hg1.node_labels[hg1_next_node]);
        hg2_walk_seq.push_back(hg2.node_labels[hg2_next_node]);        
        double prob = randdouble();
        // Restart random walk
        if(prob < RESTART)  {
            if (hg1_walk_seq.compare(hg2_walk_seq) == 0) {
                value = value + 1.0;
            }
            hg1_walk_seq.clear();
            hg2_walk_seq.clear();

            hg1_walk_seq.push_back(hg1.node_labels[hg1_root]);
            hg2_walk_seq.push_back(hg2.node_labels[hg2_root]);
            hg1_curr_node = hg1_root;
            hg2_curr_node = hg2_root;
        }
        // Continue random walk
        else  {
            hg1_curr_node = hg1_next_node;
            hg2_curr_node = hg2_next_node;
        }
        step += 1;
    }

    return value;
}

