													keys = generate_labels(mismatches, root, b, c, a, 65, e7, e8, e9, e10, ZERO_VECTOR, ZERO_VECTOR, ZERO_VECTOR, ZERO_VECTOR, ZERO_VECTOR, ZERO_VECTOR, ZERO_VECTOR);
