																	//E1={R,A,B,C}, E11={B,C}
																	keys = generate_labels(mismatches, root, a, b, c, 16, e1, e11, ZERO_VECTOR, ZERO_VECTOR, ZERO_VECTOR, ZERO_VECTOR, ZERO_VECTOR, ZERO_VECTOR, ZERO_VECTOR, ZERO_VECTOR, ZERO_VECTOR);
